import (
	context "context"
	fern "github.com/circular-references-advanced/fern"
	fernclient "github.com/circular-references-advanced/fern/client"
)

client := fernclient.NewClient()
err := client.Service.CreateMetadata(
	context.TODO(),
	&fern.CreateMetadataRequest{
		Metadata: map[string]*interface{}{
			"string": map[string]interface{}{
				"key": "value",
			},
		},
	},
)
